import React from "react";
import './Helper.css';

const [number, setNumber] = React.useState(0);

function Helper(){
    return(
        <div className="block">
            <div className="number">
                Счетчик: {number}
            </div>

            <div>
                <button className="button">Increase</button>
                <button className="button">Decrease</button>
            </div>
        </div>
    )
}

export default Helper
